import React from "react";
import "./App.css"; // Assurez-vous d'importer le fichier CSS

function App() {
    return (
        <div className="container">
            <div className="left-panel">
                {/* Contenu du côté gauche */}
                <h1>Gauche</h1>
            </div>
            <div className="right-panel">
                {/* Contenu du côté droit */}
                <h1>Droit</h1>
            </div>
        </div>
    );
}

export default App;
